function(input, output, session) {
  
  
  js <- "
    function(el, x){
      var id = el.getAttribute('id');
      var gd = document.getElementById(id);
      var d3 = Plotly.d3;
      Plotly.update(id).then(attach);
        function attach() {
          gd.addEventListener('click', function(evt) {
            var xaxis = gd._fullLayout.xaxis;
            var yaxis = gd._fullLayout.yaxis;
            var bb = evt.target.getBoundingClientRect();
            var x = xaxis.p2d(evt.clientX - bb.left);
            var y = yaxis.p2d(evt.clientY - bb.top);
            var coordinates = [x, y];
            Shiny.setInputValue('clickposition', coordinates);
          });
          gd.addEventListener('mousemove', function(evt) {
            var xaxis = gd._fullLayout.xaxis;
            var yaxis = gd._fullLayout.yaxis;
            var bb = evt.target.getBoundingClientRect();
            var x = xaxis.p2d(evt.clientX - bb.left);
            var y = yaxis.p2d(evt.clientY - bb.top);
            var coordinates = [x, y];
            Shiny.setInputValue('mouseposition', coordinates);
          });
        };
  }
  "
 
  clima =  read_xlsx("clima.xlsx")
  datos = read.csv("historicos.csv")
  dates = as.Date(clima$Fecha, format = "%d/%m/%Y")
  horas = format(clima$Time, format = "%H:%M:%S")
  date0 = as.Date(datos$Fecha_inst)
  date1 = as.Date(datos$Fecha_Rev)
  temperatura = clima$Temp
  HR = clima$HR
  
  
  # pruebas
  
  output$proof <- renderText({
    clima =  read_xlsx("clima.xlsx")
    dates = as.Date(clima$Fecha, format = "%d/%m/%Y")
    
    
    
    Yo = (input$brote)*(input$trampa)*(as.numeric(input$huevos))
    Yi1 = Yo*input$HM
    dias = (interval(start = input$fecha0, end = input$dateff)/days())+1
    hrp = interval(start = input$fecha0, end = input$dateff)/hours()-((24-(input$hordhast-input$hordesd))*dias)
    hr0.c = format(input$hordesd, format = "%H:%M:%S")
    hr1.c = format(input$hordhast, format = "%H:%M:%S")
    
    #dates2<- as.Date(clima$Fecha, format = "%d/%m/%Y")
    
    data.organizada <- data.frame(dates,horas,temperatura,HR)
    attach(data.organizada)
    
    horas.f1 <- filter(data.organizada,
                       dates >= input$fecha0 & dates <= input$dateff
                       & horas > hr0.c & horas <= hr1.c #>=
                       & temperatura >= input$tempdesd & temperatura <= input$tempdhast
                       & HR >= input$hrdesd & HR <= input$hrdhast
    )
    
    
    hrf = ceiling(dim(horas.f1)[1]/2)
    
    ind.hrf = hrf / as.numeric(hrp)
    Yi11 = round(Yi1*round(ind.hrf,2),1)
    
    x <- seq(input$fecha0 , input$dateff,by=input$PI) #+ desplazamiento por "ciclo"
    med <- (Yi11/length(x))
    y <- seq(from = min(med), to = (Yi11), by = med )
    
    v  = c(1,input$PI-1)
    a = rep(c(Yi11,0),v)
    y2 = rep(a,length(x))
    
    
    
    
    #nicia brotes
    hvs<-as.numeric(input$huevo)
    
    c4 = hvs
    c3 = hvs/2
    c2 = hvs/3
    c1 = hvs/4
    
    ci4 = 35
    ci3 = 20
    ci2 = 5
    ci1 = 1
