output$sim1 <- renderPlotly({
    
    # calculos
    clima =  read_xlsx("clima.xlsx")
    dates = as.Date(clima$Fecha, format = "%d/%m/%Y")
    
    Yo = (input$brote)*(input$trampa)*(as.numeric(input$huevos))
    Yi1 = Yo*input$HM
    
    
    dias = interval(start = input$fecha0, end = input$dateff)/days()+1
    
    hrp = interval(start = input$fecha0, end = input$dateff)/hours()-((24-(input$hordhast-input$hordesd))*dias)
    hr0.c = format(input$hordesd, format = "%H:%M:%S")
    hr1.c = format(input$hordhast, format = "%H:%M:%S")
    
    
    data.organizada <- data.frame(dates,horas,temperatura,HR)
    
    attach(data.organizada)
    
    horas.f1 <- filter(data.organizada,
                       dates >= input$fecha0 & dates <= input$dateff
                       & horas > hr0.c & horas <= hr1.c
                       & temperatura >= input$tempdesd & temperatura <= input$tempdhast
                       & HR >= input$hrdesd & HR <= input$hrdhast
    )
    
    
    hrf = ceiling(dim(horas.f1)[1]/2)
    
    ind.hrf = hrf / as.numeric(hrp)
    
    Yi11 = round(Yi1*round(ind.hrf,2),3)
    
    
    
    
    x <- seq(input$fecha0 , input$dateff,by=input$PI) #+ desplazamiento por "ciclo"
    #  
    # 
    # 
    med <- (Yi11/length(x))
    # 
    v  = c(1,input$PI-1)
    a = rep(c(Yi11,0),v)
    y2 = rep(a,length(x))
    # 
    # 
    # 
    y <- seq(from = min(med), to = (Yi11), by = med)
    PII <- input$PI-input$Pi
    d = data.frame(x,y,y2)
    
    ###########
    
    
    #####################
    
    fecha <- seq.Date(input$fecha0,input$dateff,1)
    #acums <-seq() 
    dif=length(y2)-dias
    abs = y2[-((dias):(length(y2)-1))]
    acum0 = seq(from = Yi11,to=(Yo+10),by=Yi11)
    acum1 = sort(rep(acum0,input$PI),index.return = TRUE)
    acum2 = acum1$x
    acum3 = acum2[-((dias):(length(acum2)-1))]
    
    d1 = data.frame(fecha,abs,acum3)
    
    attach(d1)
    
    #####
    
    frutos1 = plot_ly(d1, x = ~fecha, y = ~acum3, 
                      type = "scatter",mode ='lines', name = "Frutos Infestados ")
    frutos1 = frutos1 %>% add_trace(y = ~ acum3, name = '(Acum)',
                                    mode = 'markers')
    
    frutos1 =  frutos1 %>% add_trace(x = ~fecha, y = ~abs, name = "", yaxis = "y2", mode = "lines", type = "scatter")
    
    frutos1 =  frutos1 %>% add_trace(x = ~fecha, y = ~abs, name = "Absolutos", yaxis = "y2", mode = "markers")
    
    
    
    frutos1 <- frutos1 %>% layout(
      yaxis2 = ay,
      xaxis = list(title="<b>Período de observación</b>"),
      yaxis = list(title="<b>Acumulados</b>")
    )%>%
      layout(plot_bgcolor='white',
             xaxis = list(
               zerolinecolor = '#ffff',
               zerolinewidth = 2,
               gridcolor = 'ffff'),
             yaxis = list(
               zerolinecolor = '#ffff',
               zerolinewidth = 2,
               gridcolor = 'ffff'),
             legend =list(x=120,y=0.0)
      )
    frutos1 
    
    
    
    
  })


